-- Este script realiza a operação de "insert ou update" para Firebird 2.0.
-- Agora, ele utiliza variáveis para evitar a repetição de valores.

SET TERM ^ ;
EXECUTE BLOCK
AS
  -- Declaração das variáveis para armazenar os valores
  DECLARE VARIABLE exists_count INTEGER;
  DECLARE VARIABLE nova_versao_empresarial VARCHAR(60) = '2024.2';
  DECLARE VARIABLE nova_data_exe_empresarial VARCHAR(60) = '01.08.2022';
  DECLARE VARIABLE nova_versao_nfe VARCHAR(60) = 'V25.19.99';
  DECLARE VARIABLE nova_dbversion VARCHAR(60) = '9999EMP';
  DECLARE VARIABLE nova_data_lib_desenv VARCHAR(60) = '01.06.2025';
BEGIN
  -- 1. Verificamos se o registro com ID = 1 já existe.
  SELECT COUNT(*) FROM VERSAO_CONTROLE WHERE ID = 1 INTO :exists_count;

  -- 2. Se o registro não existir (count é 0), fazemos o INSERT.
  IF (exists_count = 0) THEN
  BEGIN
    INSERT INTO VERSAO_CONTROLE (ID, VERSAO_EMPRESARIAL, DATA_EXE_EMPRESARIAL, VERSAO_NFE, DBVERSION, DATA_LIBERACAO_DESENVOLVIMENTO)
    VALUES (1, :nova_versao_empresarial, :nova_data_exe_empresarial, :nova_versao_nfe, :nova_dbversion, :nova_data_lib_desenv);
  END
  -- 3. Caso contrário (o registro existe), fazemos o UPDATE.
  ELSE
  BEGIN
    UPDATE VERSAO_CONTROLE V
    SET V.versao_empresarial = :nova_versao_empresarial,
        V.data_exe_empresarial = :nova_data_exe_empresarial,
        V.versao_nfe = :nova_versao_nfe,
        V.dbversion = :nova_dbversion,
        V.data_liberacao_desenvolvimento = :nova_data_lib_desenv
    WHERE V.id  = 1;
  END
END^
SET TERM ; ^


