------------------ INICIO DO SCRIPT QUE CRIUA A TRIBUTAÇÃO FEDERAL PADRÃO --------------------------


INSERT INTO EMP_TRIBUTACAO_FEDERAL (TRIB_DTCAD, TRIB_SIT_ID, TRIB_NOME, TRIB_PIS_SIT_ENT, TRIB_COFINS_SIT_ENT, TRIB_PIS_SIT_SAIDA, TRIB_COFINS_SIT_SAIDA, TRIB_PIS_ALIQUOTA_ENT, TRIB_COFINS_ALIQUOTA_ENT, TRIB_PIS_ALIQUOTA_SAIDA, TRIB_COFINS_ALIQUOTA_SAIDA)
SELECT CURRENT_DATE, 1, 'TRIBUTAÇÃO FEDERAL PADRÃO', '71', '71', '06', '06', 0, 0, 0, 0
FROM RDB$DATABASE
WHERE NOT EXISTS (
  SELECT 1 FROM EMP_TRIBUTACAO_FEDERAL WHERE TRIB_ID = 1
);

COMMIT WORK;

------------------ FIM DO SCRIPT QUE CRIUA A TRIBUTAÇÃO FEDERAL PADRÃO --------------------------

------------------ INICIO DO SCRIPT QUE COLOCA OS ITENS SEM TTRIBUTAÇÃO FEDERAL PADRÃO --------------------------
SET TERM ^ ;
UPDATE EMP_PRODUTO P
SET P.PRD_PIS_SIT = (SELECT F.TRIB_PIS_SIT_SAIDA
                   FROM EMP_TRIBUTACAO_FEDERAL F
                   WHERE F.TRIB_ID = 1),

  P.PRD_PIS_ALIQUOTA = (SELECT F.TRIB_PIS_ALIQUOTA_SAIDA
                        FROM EMP_TRIBUTACAO_FEDERAL F
                        WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_SIT = (SELECT F.TRIB_COFINS_SIT_SAIDA
                      FROM EMP_TRIBUTACAO_FEDERAL F
                      WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_ALIQUOTA = (SELECT F.TRIB_COFINS_ALIQUOTA_SAIDA
                           FROM EMP_TRIBUTACAO_FEDERAL F
                           WHERE F.TRIB_ID = 1),

  P.PRD_PIS_SIT_ENT = (SELECT F.TRIB_PIS_SIT_ENT
                       FROM EMP_TRIBUTACAO_FEDERAL F
                       WHERE F.TRIB_ID = 1),

  P.PRD_PIS_ALIQUOTA_ENT = (SELECT F.TRIB_PIS_ALIQUOTA_ENT
                            FROM EMP_TRIBUTACAO_FEDERAL F
                            WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_SIT_ENT = (SELECT F.TRIB_COFINS_SIT_ENT
                          FROM EMP_TRIBUTACAO_FEDERAL F
                          WHERE F.TRIB_ID = 1),

  P.PRD_COFINS_ALIQUOTA_ENT  = (SELECT F.TRIB_COFINS_ALIQUOTA_ENT
                                FROM EMP_TRIBUTACAO_FEDERAL F
                                WHERE F.TRIB_ID = 1),
  P.PRD_FKTRIB_FEDERAL_ID = (SELECT F.TRIB_ID
                                FROM EMP_TRIBUTACAO_FEDERAL F
                                WHERE F.TRIB_ID = 1)
WHERE P.PRD_FKTRIB_FEDERAL_ID IS NULL;

^
SET TERM; ^

COMMIT WORK;

------------------ FIM DO SCRIPT QUE COLOCA OS ITENS SEM TRIBUTAÇÃO FEDERAL PADRÃO --------------------------

------------------ INICIO DO SCRIPT QUE CADASTRA AS UNIDADES DE MEDIDA QUE NÃO EXISTEM --------------------------
INSERT INTO EMP_PRODUTO_UNDMEDIDA (UND_DTCAD, UND_NOME, UND_APELIDO)
SELECT CURRENT_DATE, I.NFEI_LKUND_FISICA_SIGLA, I.NFEI_LKUND_FISICA_SIGLA
FROM EMP_ENTRADAI I
WHERE I.NFEI_LKUND_FISICA_SIGLA IS NOT NULL 
AND I.NFEI_LKUND_FISICA_SIGLA <> ''
AND I.NFEI_LKUND_FISICA_SIGLA
    NOT IN (SELECT E.UND_APELIDO FROM EMP_PRODUTO_UNDMEDIDA E);

COMMIT WORK;
------------------ FIM DO SCRIPT QUE CADASTRA AS UNIDADES DE MEDIDA QUE NÃO EXISTEEM --------------------------

