------------------ INICIO DO SCRIPT QUE COLOCA A UNIDADE DE MEDIDA IGUAL A DA COMPRA --------------------------
SET TERM ^ ;
UPDATE EMP_PRODUTO P
SET P.PRD_FKUNDBASE_ID = 
  (SELECT FIRST 1 E.UND_ID
   FROM EMP_PRODUTO_UNDMEDIDA E
   WHERE E.UND_APELIDO = 
         (SELECT FIRST 1 I.NFEI_LKUND_FISICA_SIGLA
          FROM EMP_ENTRADAI I
          WHERE I.NFEI_FKPRD_ID = P.PRD_ID 
          ORDER BY I.NFEI_DTCAD DESC)
   ORDER BY E.UND_ID DESC)
WHERE P.PRD_ID = P.PRD_ID
AND EXISTS (
  SELECT 1 FROM EMP_PRODUTO_UNDMEDIDA E
  WHERE E.UND_APELIDO = 
        (SELECT FIRST 1 I.NFEI_LKUND_FISICA_SIGLA
         FROM EMP_ENTRADAI I
         WHERE I.NFEI_FKPRD_ID = P.PRD_ID 
         ORDER BY I.NFEI_DTCAD DESC)
);


^
SET TERM; ^

COMMIT WORK;
------------------ FIM DO SCRIPT QUE COLOCA A UNIDADE DE MEDIDA IGUAL A DA COMPRA --------------------------

------------------ INICIO SCRIPT QUE RECALCULA PIS E COFINS IGUAL AO CADASTRO DO ITEM --------------------------
SET TERM ^ ;
/*RECALCULA TODOS OS ITENS*/
UPDATE EMP_NFSI NSI
SET             NSI.NFSI_CST_PIS_SPED = (SELECT P.PRD_PIS_SIT
                                        FROM EMP_PRODUTO P
                                        WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID) ,

                NSI.NFSI_VL_BC_PIS_SPED = NSI.NFSI_PRD_VLR_TOTAL-NSI.NFSI_ICMS_VLR_ALQ,
                NSI.NFSI_PER_ALIQ_PIS_SPED = (SELECT P.PRD_PIS_ALIQUOTA
                                              FROM EMP_PRODUTO P
                                              WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID),

                NSI.NFSI_QTD_BC_PIS_SPED = NSI.NFSI_PRD_VLR_TOTAL-NSI.NFSI_ICMS_VLR_ALQ,
                NSI.NFSI_VL_ALIQ_PIS_SPED = NSI.NFSI_QTD_BC_PIS_SPED * (((SELECT P.PRD_PIS_ALIQUOTA
                                                                       FROM EMP_PRODUTO P 
                                                                       WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID)) / 100),


                NSI.NFSI_CST_COFINS_SPED = (SELECT P.PRD_COFINS_SIT
                                            FROM EMP_PRODUTO P
                                            WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID) ,

                NSI.NFSI_VL_BC_COFINS_SPED = NSI.NFSI_PRD_VLR_TOTAL-NSI.NFSI_ICMS_VLR_ALQ,
                NSI.NFSI_PER_ALIQ_COFINS_SPED = (SELECT P.PRD_COFINS_ALIQUOTA
                                                 FROM EMP_PRODUTO P
                                                 WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID),
                NSI.NFSI_QTD_BC_COFINS_SPED = NSI.NFSI_PRD_VLR_TOTAL-NSI.NFSI_ICMS_VLR_ALQ,
                NSI.NFSI_VL_ALIQ_COFINS_SPED = NSI.NFSI_QTD_BC_COFINS_SPED * (((SELECT P.PRD_COFINS_ALIQUOTA
                                                                             FROM EMP_PRODUTO P
                                                                             WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID)) / 100),

                NSI.NFSI_COFINS_ST  = (SELECT P.PRD_COFINS_SIT
                                        FROM EMP_PRODUTO P
                                        WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID) ,

                NSI.NFSI_PIS_ST = (SELECT P.PRD_PIS_SIT
                                   FROM EMP_PRODUTO P
                                   WHERE P.PRD_ID = NSI.NFSI_FKPRD_ID)

WHERE NSI.NFSI_ID = NSI.NFSI_ID
^
SET TERM; ^

COMMIT WORK;

