------------------ INICIO DO SCRIPT QUE CORRIGE OS EMITENTEES CORRETOS QUANDO A DEVOLUÇÃO DE ENTRADA É EMITIDA PELA PROPRIA LICENCIADA --------------------------

SET TERM ^ ;
UPDATE EMP_ENTRADA E
SET E.NFE_FKEMITENTE_ID = (SELECT S.NFS_FKCLIENTE_ID
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKEMITENTE_NOME = (SELECT S.NFS_LKCLIENTE_NOME
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKENTD_CPFCNPJ= (SELECT S.NFS_LKCLIENTE_CNPJ_CPF
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKENTD_INSCE= (SELECT S.NFS_LKCLIENTE_INSC_EST
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKEEND= (SELECT S.NFS_LKCLIENTE_EEND
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKECOMPL= (SELECT S.NFS_LKCLIENTE_ECOMPL
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKEBAI= (SELECT S.NFS_LKCLIENTE_EBAI
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_EFKCID_ID= (SELECT S.NFS_LKCLIENTE_EFKCID_ID
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_ELKCID_NOME= (SELECT S.NFS_LKCLIENTE_ELKCID_NOME
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_EFKUF_ID= (SELECT S.NFS_LKCLIENTE_EFKUF_ID
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_ELKUF_NOME= (SELECT S.NFS_LKCLIENTE_ELKUF_NOME
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKECEP= (SELECT S.NFS_LKCLIENTE_ECEP
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKETEL1DDD= (SELECT S.NFS_LKCLIENTE_ETEL1DDD
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE),
    E.NFE_LKETEL1 = (SELECT S.NFS_LKCLIENTE_ETEL1
                           FROM EMP_NFS S
                           INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
                           WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE) ,
    E.NFE_TIPO_FINALIDADE = 'Devolução de Clientes'
WHERE E.NFE_VINCULO_CHAVE IS NOT NULL
AND EXISTS (SELECT 1
            FROM EMP_NFS S
            INNER JOIN EMP_NFS_RETORNO R ON (R.NFSR_FKNFS_ID = S.NFS_ID)
            WHERE R.NFSR_CHAVEACESSO = E.NFE_VINCULO_CHAVE AND S.NFS_FKCLIENTE_ID IS NOT NULL);

^
SET TERM; ^

COMMIT WORK;

