SET TERM ^ ;
update emp_nfs s
set s.nfs_vlr_total_nfarr = s.nfs_vlr_total_nf,
    s.nfs_total_bruto =  s.nfs_vlr_total_nf
where s.nfs_id = s.nfs_id
and s.nfs_total_bruto is null
^
SET TERM; ^

COMMIT WORK;


