set i.nfsi_prd_vlr_totarr = i.nfsi_prd_vlr_total,
    i.nfsi_total_bruto = i.nfsi_prd_vlr_total
where i.nfsi_total_bruto is null

^
SET TERM; ^

COMMIT WORK;


