INSERT INTO EMP_CCREDPRES (CCREDPRES_CODIGO, CCREDPRES_DESCRICAO, CCREDPRES_DECRETO, CCREDPRES_DTCAD, CCREDPRES_FKSIT)
SELECT 
    5, 
